import React, { Component } from 'react';
import Row from './Row';

class Board extends Component {
  constructor(props) {
    super(props);

    this.state = {
      board: {}
    }
  }

  render() {
    var rows = [];
    for(var i = 0; i < 8; i++) {
      rows.push(<Row row={i} key={i}/>);
    }
    return <div style={{border: "1px solid black", margin: 0}}>{rows}</div>;
  }

}

export default Board;
